using Amazon.CDK.AWS.S3;
using Amazon.CDK.AWS.SES.Actions;


var bucket = new Bucket(this, "Bucket");
var topic = new Topic(this, "Topic");

new ReceiptRuleSet(this, "RuleSet", new ReceiptRuleSetProps {
    Rules = new [] { new ReceiptRuleOptions {
        Recipients = new [] { "hello@aws.com" },
        Actions = new [] {
            new AddHeader(new AddHeaderProps {
                Name = "X-Special-Header",
                Value = "aws"
            }),
            new S3(new S3Props {
                Bucket = bucket,
                ObjectKeyPrefix = "emails/",
                Topic = topic
            }) }
    }, new ReceiptRuleOptions {
        Recipients = new [] { "aws.com" },
        Actions = new [] {
            new Sns(new SnsProps {
                Topic = topic
            }) }
    } }
});

go.source:
import s3 "github.com/aws-samples/dummy/awscdkawss3"
import "github.com/aws-samples/dummy/awscdkawssesactions"


bucket := s3.NewBucket(this, jsii.String("Bucket"))
topic := sns.NewTopic(this, jsii.String("Topic"))

ses.NewReceiptRuleSet(this, jsii.String("RuleSet"), &ReceiptRuleSetProps{
	Rules: []receiptRuleOptions{
		&receiptRuleOptions{
			Recipients: []*string{
				jsii.String("hello@aws.com"),
			},
			Actions: []iReceiptRuleAction{
				actions.NewAddHeader(&AddHeaderProps{
					Name: jsii.String("X-Special-Header"),
					Value: jsii.String("aws"),
				}),
				actions.NewS3(&S3Props{
					Bucket: *Bucket,
					ObjectKeyPrefix: jsii.String("emails/"),
					Topic: *Topic,
				}),
			},
		},
		&receiptRuleOptions{
			Recipients: []*string{
				jsii.String("aws.com"),
			},
			Actions: []*iReceiptRuleAction{
				actions.NewSns(&SnsProps{
					Topic: *Topic,
				}),
			},
		},
	},
})

